Rules.InvariantScript:
Set(
    gvCRUDProduct,
    Blank()
);Set(
    gvCRUDProductID,
    0
);
Set(
    fProductOrdersByProduct,
    ProductDetails.dboProductOrdersByProduct({ProductID: gvCRUDProductID}).ResultSets.Table1
);
Set(
    gvCRUDType,
    fMagicNo.gvCRUDC
);
Set(
    gvTGLProductInventory,
    !gvTGLProductInventory
);
Set(
    gvDiscontinued,
    false
);
Navigate(scrProductCRUD);

SortByColumns(
    With(
        {records: 'fProductList'},
        ForAll(
            Sequence(CountRows(records)),
            Patch(
                Last(
                    FirstN(
                        records,
                        Value
                    )
                ),
                {rowNumber: Value}
            )
        )
    ),
    "ProductCategoryID",
    SortOrder.Ascending,
    "ProductName",
    SortOrder.Ascending,
    "rowNumber",
    SortOrder.Descending
)

Select(Parent);
Set(
    gvCRUDProductID,
    Parent.Selected.ProductID
);
Set(
    gvCRUDProductIDReturn,
    gvCRUDProductID
);
Set(
    gvDiscontinued,
    false
);
Set(
    gvCRUDType,
    fMagicNo.gvCRUDU
);
Set(
    gvClearProductDescription,
    0
);
Set(
    gvTGLProductInventory,
    !gvTGLProductInventory
);
Set(
    fProductOrdersByProduct,
    ProductDetails.dboProductOrdersByProduct({ProductID: gvCRUDProductID}).ResultSets.Table1
);
Navigate(scrProductCRUD);
